Funciones avanzadas/require.sol.content:
pragma solidity ^0.6.0;

contract Require{


    function password(string memory pass) public pure returns (bool){
        require(keccak256(abi.encodePacked(pass)) == keccak256(abi.encodePacked("1")));

    }

}

